import React from "react";

const Login = () => {
  return (
    <form action="">
      <label for="Name">Name</label>
      <input type="text" placeholder="username" id="text" />
      <label for="Roll No.">Roll No.</label>
      <input type="phone" placeholder="Roll No." id="number" />
    </form>
  );
};

export default Login;
